import '../css/other.css'
import {motion} from 'framer-motion'

const Links = () =>{

    return(
        <motion.div id = "links" initial = {{opacity : 0,y : 100 }}
        animate = {{
          opacity:1,
          y : 0,
          transition : {
            delay : 1,
            duration: 1
          }
        }}>
          <i  className="github icon"></i><br/>
          <i className="linkedin icon"></i><br/>
          <i class="twitter icon"></i>
        </motion.div>
    )

}

export default Links
